import React from "react";
import { useNavigate } from "react-router-dom";


const Logout = () => {
    const navigate = useNavigate();

    const onSubmitDelete = () => {
        localStorage.clear();
        navigate("/login");
    }

    return (
        <div>
            <img src="https://fever.imgix.net/plan/photo/eb08ca54-df02-11eb-a640-965862e5b8d4.jpg?w=550&h=550&auto=format&fm=jpg" alt="Stranger things" />
            <div id="logout">
                <button className="button" onClick={onSubmitDelete} >Logout</button>
            </div>

        </div>
    )
}



export default Logout;
